		function showinitialmove()
		{
			hashParts = location.hash.substr(1).split('#');
			var firstChar = hashParts[0].substr(0,1);

			if (firstChar < '0' || firstChar > '9')
				hashParts.splice(0,0,firstChar);	//"0");

			if (location.hash) gMove = parseInt(hashParts[0]);
			if (gMove > maxmove) gMove = maxmove;

			if (gMove)
			{
				showmove(gMove-1);
				nextmove();
			}
			else
				showmove(0);
		}
